function on.save()
	return { highScore1, highScore2 }
end

function on.restore(state)
	highScore1 = state[1]	-- hard score
	highScore2 = state[2]	-- easy score
end

on.escapeKey()	-- presses the escape key to initialize the program

if highScore1 == nil then	-- if there is not yet a high score then the variable is reset.
	highScore1 = 0
end

if highScore2 == nil then
	highScore2 = 0
end

function on.paint(gc)
	keyDisabler = false

	if titles then	-- if splashscreen
	
		gc:setFont("sansserif", "r", 12)
		easyX = 15
			easyY = 105
			easyW = gc:getStringWidth("Easy") + 10
			easyH = gc:getStringHeight("Easy") + 10
		hardX = 15
			hardY = 145
			hardW = gc:getStringWidth("Hard") + 10
			hardH = gc:getStringHeight("Hard") + 10
		
		if timerSpeed == 12 then	-- draws highlighter for buttons			
			gc:drawRect(easyX, easyY, easyW, easyH)
		else
			gc:drawRect(hardX, hardY, hardW, hardH)
		end
		
		gc:drawString("Easy", 20, 110, "top")		-- draws Easy and Hard
		gc:drawString("Hard", 20, 150, "top")
		
		gc:drawString("High score " .. highScore2, 90, 110, "top")	-- draws high scores
		gc:drawString("High score " .. highScore1, 90, 150, "top")
		
		gc:setFont("sansserif", "b", 13)		-- steps to draw the play button
		
			playX = 250
			playY = 130
			playW = gc:getStringWidth("PLAY") + 10
			playH = gc:getStringHeight("PLAY") + 10
		
		gc:fillRect(playX, playY, playW, playH)
		gc:setColorRGB(255, 255, 255)
		gc:drawString("PLAY", 255, 135, "top")
		
		gc:setColorRGB(0, 0, 0)
		gc:setFont("sansserif", "b", 9)
		gc:drawString("Steer with arrows or numpad. Hit targets; avoid all else.", 1, 190, "top")
		
		gc:drawImage(splashscreen, 0, 0)
		-- draws the titles

	end
	
	
	if game then	-- if the game is being played
		gc:drawRect(-1, -1, 301, 201)
		gc:setFont("sansserif", "r", 7)
		gc:drawString(score, 302, 100, "middle")
		if timerSpeed == 6 then
			gc:drawString("/" .. highScore1, 302, 115, "middle")
		else
			gc:drawString("/" .. highScore2, 302, 115, "middle")
		end
		gc:drawString("ActionSnake 2.0 is a game by Karl Noss. Visit KarlNoss.com", 0, 198, "top")
		
		if gameOver then	-- if gameOver has been triggered
			gc:setFont("sansserif", "b", 20)
			gc:drawString("GAME OVER", 30, 40, "bottom")	-- draws GAME OVER
			
			if timerSpeed == 6 then
				if score > highScore1 then
					highScore1 = score
					gc:drawString("New hard high", 30, 80, "bottom")
					gc:drawString("score of " .. score .. "!", 30, 120, "bottom")
					document.markChanged()
				end
			else
				if score > highScore2 then
					highScore2 = score
					gc:drawString("New easy high", 30, 80, "bottom")
					gc:drawString("score of " .. score .. "!", 30, 120, "bottom")
					document.markChanged()
				end
			end
			return
		end
		
		--[[gc:drawString("snakeX[1]: " .. snakeX[1], 10, 10, "bottom")
		gc:drawString("snakeY[1]: " .. snakeY[1], 10, 25, "bottom")
		gc:drawString("targetX: " .. targetX, 10, 40, "bottom")
		gc:drawString("targetY: " .. targetY, 10, 55, "bottom")
		gc:drawString("score: " .. score, 10, 70, "bottom")
		gc:drawString("# snakeX: " .. # snakeX, 10, 85, "bottom")
		gc:drawString("# snakeY: " .. # snakeY, 10, 100, "bottom")--]]
		-- debuging strings	

		moveSnake()	-- moves the snakes position. Triggers a gameOver if snake hits itself or goes out of bounds
		
		gc:drawImage(target, (targetX) * 15, (targetY) * 10)	-- draws the target on screen, using the previously created locations
				
		-- checking to see if snake == target
		for i = 1, # snakeX, 1 do
				if snakeX[i] == targetX and snakeY[i] == targetY then	-- if the selected portion of the snake matches the target
					if i == 1 then							-- if this was not an accidental score
						score = score + 1					-- increments user's score
						table.insert(snakeX, 1, targetX)	-- adds target location to the start of the snake
						table.insert(snakeY, 1, targetY)
					end
					getNewTarget()	-- gets a new target for next time. Next time the snake moves, it will check against
				end
		end

		for i = 1, # snakeX, 1 do	-- draws the snake on the screen using the moveSnake() locations added during this call to on.paint().
									-- If gameOver is on, snake still is drawn this time—but not the next.
			gc:drawImage(snaketile, snakeX[i] * 15, snakeY[i] * 10)
		end
		
	timer.start(0.01)
	-- starts timer going for next time.

	end

end
function on.timer()
	timerCount = timerCount + 1		-- increments the timerCount.
	if timerCount == timerSpeed then	-- when the timerCount has reached the limit set by timerSpeed
		timerCount = 0
		timer.stop()
		--resets timerCount, stops timer

		platform.window:invalidate()	-- repaints
	end

end


function newGame()

	math.randomseed( timer.getMilliSecCounter() )	-- seeds the random number generator
	
	snakeDir = "w"

	snakeX = { 17, 18, 19 }

	snakeY = { 15, 15, 15 }
	
	score = 0
	gameOver = false
	
	getNewTarget()
end

function getNewTarget()
	targetX = math.random(17) + 1	-- For both X and Y, the values are from 1 to 18 out of 0 to 19
	targetY = math.random(17) + 1
end

function moveSnake()	
	for i = 3, # snakeX, 1 do	-- checks to see if snake has collided with itself.
		if snakeX[i] == snakeX[1] and snakeY[i] == snakeY[1] then	-- if the current snake location is listed twice
			gameOver = true	-- GAME OVER
			return
		end
	end
	
	if snakeDir == "n" then
		if snakeY[1] - 1 > -1 then	-- checks to see if snake is out of bounds
			table.insert(snakeX, 1, snakeX[1])	-- inserts current snakeX value
			table.insert(snakeY, 1, snakeY[1] - 1)	-- inserts new snakeY value
		else
			gameOver = true
			return
		end
		
	elseif snakeDir == "e" then
		if snakeX[1] + 1 < 20 then	-- checks to see if snake is out of bounds
			table.insert(snakeX, 1, snakeX[1] + 1)	-- inserts new snakeX value
			table.insert(snakeY, 1, snakeY[1])	-- inserts current snakeY value
		else
			gameOver = true
			return
		end
		
	elseif snakeDir == "s" then
		if snakeY[1] + 1 < 20 then	-- checks to see if snake is out of bounds
			table.insert(snakeX, 1, snakeX[1])	-- inserts current snakeX value
			table.insert(snakeY, 1, snakeY[1] + 1)	-- inserts new snakeY value
		else
			gameOver = true
			return
		end
		
	elseif snakeDir == "w" then
		if snakeX[1] - 1 > -1 then	-- checks to see if snake is out of bounds
			table.insert(snakeX, 1, snakeX[1] - 1)	-- inserts new snakeX value
			table.insert(snakeY, 1, snakeY[1])	-- inserts current snakeY value
		else
			gameOver = true
			return
		end
	end
	
	table.remove(snakeX, # snakeX)
	table.remove(snakeY, # snakeY)
end

function on.charIn(ch)
	if ch == "8" then
		on.arrowUp()
	elseif ch == "2" or ch == "5" then
		on.arrowDown()
	elseif ch == "4" then
		on.arrowLeft()
	elseif ch == "6" then
		on.arrowRight()
	end
end

function on.enterKey()	-- disables splashscreen, sets the mode to GAME, sets the initial values, and repaints.

	if gameOver then
		
		titles = true
		game = false
		gameOver = false
		
	else

		titles = false

		game = true

		newGame()
		platform.window:invalidate()
	
	end

end

function on.arrowLeft()
	if ( snakeDir == "n" or snakeDir == "s" ) and keyDisabler == false then
		snakeDir = "w"
		keyDisabler = true
	end
end

function on.arrowRight()
	if ( snakeDir == "n" or snakeDir == "s" ) and keyDisabler == false then
		snakeDir = "e"
		keyDisabler = true
	end
end

function on.arrowUp()
	if ( snakeDir == "e" or snakeDir == "w" ) and keyDisabler == false then
		snakeDir = "n"
		keyDisabler = true
	end
end

function on.arrowDown()
	if ( snakeDir == "e" or snakeDir == "w" ) and keyDisabler == false then
		snakeDir = "s"
		keyDisabler = true
	end
end

function on.tabKey()			-- switches between Easy and Hard while in the splashscreen
	if game == false then
		if timerSpeed == 12 then
			timerSpeed = 6	-- sets to hard
		else
			timerSpeed = 12	-- sets to easy
		end
		platform.window:invalidate()	-- repaints in order to notify user of change
	end
end

function on.mouseDown(x,y)
	if (x >= easyX and x <= easyX + easyW and y >= easyY and y <= easyY + easyH) or (x >= hardX and x <= hardX + hardW and y >= hardY and y <= hardY + hardH) then
		on.tabKey()
	elseif x >= playX and x <= playX + playW and y >= playY and y <= playY + playH then
		on.enterKey()
	end
end
